const Quote = ({ age, name , data}) => {

  return (
    <div>
      {data.quotes.map((d) =>
      {
        return
        <div key={d.id}>
          <h1>{d.quote}</h1>
          <p>{d.author}</p>

        </div>
      })}
    </div>
  )
}
export default Quote
